/**
 * given the reads to transcript mapping, and theta, calc E_Nt: (which basically calcs the
 * posterior) $$E(N_t) = \sum_i \frac{ P(r_i | t)\cdot \theta_t} {\sum_{t'} P(r_i | t')\cdot
 * \theta_{t'}}$$
 *
 * @param string
 * @param theta
 * @return
 */
private static Vector<Double> calcE_Nt(
    String file,
    Vector<Double> theta,
    HashMap<String, Integer> transcriptIndices,
    Vector<Double> likeTerm2)
    throws IOException {
  int numT = theta.size();
  Vector<Double> E_Nt = new Vector<Double>();
  initVecToZero(E_Nt, numT);
  BufferedReader fileB = new BufferedReader(new FileReader(file));
  String l, read, trans;
  Double prob;

  Vector<Double> tmpPerReadName = new Vector<Double>();
  initVecToZero(tmpPerReadName, numT);
  String prevRead = "";
  while (fileB.ready()) {

    l = fileB.readLine();
    // 61G9EAAXX100520:5:100:10000:5699
    // comp3190_c716_seq2_FPKM_all:11.742_FPKM_rel:2.677_len:2401_path:[40631,40349,40358,2726]
    // 376-444 558-444 -0.0305
    // 61G9EAAXX100520:5:100:10000:5699
    // comp3190_c716_seq4_FPKM_all:13.841_FPKM_rel:6.304_len:2888_path:[0,40349,40358,2726]
    // 863-931 1045-931 -0.0305
    // 61G9EAAXX100520:5:100:10000:7578
    // comp754_c304_seq1_FPKM_all:27.333_FPKM_rel:2.886_len:901_path:[28182,65285,65293,65295,517,535,538,1140,1147,1289] 417-485 535-485 -0.0111
    // readName transName locRead2 locRead2 prob
    String[] fields = l.split("\t");
    read = fields[0];
    trans = fields[1];
    prob = Math.pow(10, Double.parseDouble(fields[4]));

    int t_id = transcriptIndices.get(trans);

    if (read.equals(prevRead)) {
      // deal with this read
      tmpPerReadName.set(t_id, tmpPerReadName.get(t_id) + prob);

    } else {
      // new read, close the prevRead
      if (!prevRead.equals("")) {
        // tmpPerReadName holds now P(r_i | T)
        likeTerm2.set(0, likeTerm2.get(0) + sumLogVector(tmpPerReadName));

        dotMultiply(tmpPerReadName, theta);
        normVector(tmpPerReadName);

        addToVector(E_Nt, tmpPerReadName);

        // prepare for the next read
        initVecToZero(tmpPerReadName, numT);
      }
      // deal with this read
      tmpPerReadName.set(t_id, tmpPerReadName.get(t_id) + prob);

      prevRead = read;
    }
  }

  // handle the last read
  // tmpPerReadName holds now P(r_i | T)
  likeTerm2.set(0, likeTerm2.get(0) + sumLogVector(tmpPerReadName));

  dotMultiply(tmpPerReadName, theta);
  normVector(tmpPerReadName);

  addToVector(E_Nt, tmpPerReadName);

  return E_Nt;
}

/**
 * This function is called when reading a kinetics Library.txt file, if the kinetics tag is
 * Arrhenius. As of today, no rxn families in the RMG database are labeled Arrhenius. Instead of
 * passing only the information after the node(s), i.e. Trange, A, n, Ea, etc., the entire data
 * entry is passed. The string p_string contains the entire line of data (including the randomly
 * assigned number and node(s)). The integer p_keyNum contains the number of nodes associated with
 * this data entry (e.g. 1 for Beta_Scission, 2 for H_Abstraction, 3 for Diels_Alder_Addition,
 * etc.). The output is of type ArrheniusKinetics. The "source" contains the set of nodes
 * associated with this data, and the "comments" are the end-of-line comments, hopefully denoting
 * where this data came from.
 */
public static ArrheniusKinetics parseArrheniusKinetics(String p_string, int p_keyNum) {
  StringTokenizer token = new StringTokenizer(p_string);
  String dummyCounter = token.nextToken(); // This should be the #. associated with the data
  // Set the source of this data as the set of nodes
  String source = "";
  for (int i = 0; i < p_keyNum - 1; i++) {
    source += token.nextToken() + " ";
  }
  source += token.nextToken();
  String TRange = token.nextToken();
  double A = Double.parseDouble(token.nextToken());
  if (A < 0) throw new NegativeAException("Negative A:" + String.valueOf(A));
  double n = Double.parseDouble(token.nextToken());
  double E = Double.parseDouble(token.nextToken());
  double DA = 1;
  String s = token.nextToken();
  if (s.startsWith("*")) {
    s = s.substring(1, s.length());
    DA = Math.abs(Double.parseDouble(s));
    if (DA < 1)
      throw new InvalidUncertaintyException(
          "Multiplier Uncertainty of A (<1): " + String.valueOf(DA));
  } else {
    // if not multiplier uncertain, transfer it into multiplier for A
    DA = Math.abs(Double.parseDouble(s));
    if (DA == 0) DA = 1;
    else if (DA > A)
      throw new NegativeAException("lower bound of A(<0): " + String.valueOf(A - DA));
    else {
      DA = A / (A - DA);
    }
  }
  double Dn = Double.parseDouble(token.nextToken());
  double DE = Double.parseDouble(token.nextToken());
  int rank = Integer.parseInt(token.nextToken());
  UncertainDouble ua = new UncertainDouble(A, DA, "Multiplier");
  UncertainDouble un = new UncertainDouble(n, Dn, "Adder");
  UncertainDouble ue = new UncertainDouble(E, DE, "Adder");
  // Set the comments of this data to whatever (if anything) follows the rank
  String comments = "";
  while (token.hasMoreTokens()) comments += token.nextToken() + " ";
  ArrheniusKinetics k = new ArrheniusKinetics(ua, un, ue, TRange, rank, source, comments);
  return k;
}

/**
 * If the next token is a double, consume it and return its value. Otherwise, throw a {@link
 * ParseException}.
 */
public double consumeDouble() throws ParseException {
  // We need to parse infinity and nan separately because
  // Double.parseDouble() does not accept "inf", "infinity", or "nan".
  if (DOUBLE_INFINITY.matcher(currentToken).matches()) {
    boolean negative = currentToken.startsWith("-");
    nextToken();
    return negative ? Double.NEGATIVE_INFINITY : Double.POSITIVE_INFINITY;
  }
  if (currentToken.equalsIgnoreCase("nan")) {
    nextToken();
    return Double.NaN;
  }
  try {
    double result = Double.parseDouble(currentToken);
    nextToken();
    return result;
  } catch (NumberFormatException e) {
    throw floatParseException(e);
  }
}

