private Object parse_simple_value(FieldDefinition f, String s) {

  if (s.equalsIgnoreCase(NULL_VALUE)) return null;
  switch (f.getBaseType()) {
    case Types.TYPE_BOOLEAN:
      return Boolean.parseBoolean(s);
    case Types.TYPE_LONG:
      return Long.parseLong(s);
    case Types.TYPE_INT:
      return Integer.parseInt(s);
    case Types.TYPE_DOUBLE:
      return Double.parseDouble(s);
    case Types.TYPE_FLOAT:
      return Float.parseFloat(s);
    case Types.TYPE_STRING:
    case Types.TYPE_TEXT:
      return s;
    case Types.TYPE_DATE:
      try {
        return spreadsheet_date_formatter.parse(s);
      } catch (ParseException e1) {
        e1.printStackTrace();
        return null;
      }
    case Types.TYPE_BLOB:
      return Byte.parseByte(s);
    case Types.TYPE_REFERENCE:
      Entity e = new Entity();
      String[] type_id = s.split(":");
      e.setType(type_id[0]);
      e.setId(Long.parseLong(type_id[1]));
      return e;
    default:
      return s;
  }
}

@Override
public Object convert(final Object fromObject) {
  String s = (String) fromObject;
  if (s == null || (s = s.trim()).length() == 0) {
    throw new IllegalArgumentException();
  }
  if (s.charAt(s.length() - 1) == 'f') {
    if (s.endsWith("Inf")) { // $NON-NLS-1$
      s = s.substring(0, s.length() - 3) + "Infinity"; // $NON-NLS-1$
    } else {
      s = s.substring(0, s.length() - 1);
    }
  }
  return Double.parseDouble(s);
}

/**
 * Read a script file of the form: lines of text with duration in seconds, read probability and
 * write probability, separated by white space.
 *
 * @param filename Script file
 * @return 0 if successful, -1 if not
 * @throws IOException if errors with file IO
 */
private int loadScriptFile(String filename) throws IOException {
  FileReader fr = new FileReader(new File(filename));
  BufferedReader br = new BufferedReader(fr);
  ArrayList<Long> duration = new ArrayList<Long>();
  ArrayList<Double> readProb = new ArrayList<Double>();
  ArrayList<Double> writeProb = new ArrayList<Double>();
  int lineNum = 0;

  String line;
  // Read script, parse values, build array of duration, read and write probs
  while ((line = br.readLine()) != null) {
    lineNum++;
    if (line.startsWith("#") || line.isEmpty()) // skip comments and blanks
    continue;

    String[] a = line.split("\\s");
    if (a.length != 3) {
      System.err.println("Line " + lineNum + ": Incorrect number of parameters: " + line);
    }

    try {
      long d = Long.parseLong(a[0]);
      if (d < 0) {
        System.err.println("Line " + lineNum + ": Invalid duration: " + d);
        return -1;
      }

      double r = Double.parseDouble(a[1]);
      if (r < 0.0 || r > 1.0) {
        System.err.println("Line " + lineNum + ": The read probability must be [0, 1]: " + r);
        return -1;
      }

      double w = Double.parseDouble(a[2]);
      if (w < 0.0 || w > 1.0) {
        System.err.println("Line " + lineNum + ": The read probability must be [0, 1]: " + r);
        return -1;
      }

      readProb.add(r);
      duration.add(d);
      writeProb.add(w);
    } catch (NumberFormatException nfe) {
      System.err.println(lineNum + ": Can't parse: " + line);
      return -1;
    }
  }

  br.close();
  fr.close();

  // Copy vectors to arrays of values, to avoid autoboxing overhead later
  durations = new long[duration.size()];
  readProbs = new double[readProb.size()];
  writeProbs = new double[writeProb.size()];

  for (int i = 0; i < durations.length; i++) {
    durations[i] = duration.get(i);
    readProbs[i] = readProb.get(i);
    writeProbs[i] = writeProb.get(i);
  }

  if (durations[0] == 0)
    System.err.println("Initial duration set to 0. " + "Will loop until stopped manually.");

  return 0;
}

/**
 * Creates a new question session for the given question.
 *
 * <p>API METHOD: This method signature must not be changed in future (after initial release)
 * unless careful attention is paid to simultaneous changes of Test Navigator. In general, if
 * additional parameters or return values are added, a new method should be defined.
 *
 * <h3>Obtaining question file</h3>
 *
 * If the question engine already has this question in its cache, it will use that (questions of
 * the same version are guaranteed not to change). Otherwise it retrieves questions using the
 * following URL:
 *
 * <p><i>questionBaseURL</i>/<i>questionID</i>.<i>questionversion</i>
 *
 * <p>For security reasons, the URL may be https: and the test navigator (which is likely to be
 * the thing serving the URL) will operate an IP whitelist, only responding to requests from
 * question engines it has already initiated connections to.
 *
 * <h3>Initial parameters</h3>
 *
 * initialParamNames and initialParamValues (which must be of equal length) include initial
 * configuration parameters to be passed to the question.
 *
 * <table border="1">
 * <tr><th>Name</th><th>Value</th></tr>
 * <tr><td>randomseed</td><td>Random number seed given to question, which
 * should be based on the current user, the test, and the number of times
 * they've started this question before. Parsed as decimal integer (up to
 * 64 bit)</td></tr>
 * </table>
 *
 * @param questionID Unique ID of question
 * @param questionVersion Version identifier of question (should include only filename-space
 *     characters, probably just digits and full stops). May be null, to indicate that the
 *     question may not be cached (for preview usage only)
 * @param questionBaseURL Base URL for questions (see above)
 * @param initialParamNames Names of initial parameters
 * @param initialParamValues Values of initial parameters
 * @param cachedResources List of resources that the Test Navigator has cached
 * @return Various data in order to provide the initial page of the question
 * @throws OmException Whenever something goes wrong
 */
public StartReturn start(
    String questionID,
    String questionVersion,
    String questionBaseURL,
    String[] initialParamNames,
    String[] initialParamValues,
    String[] cachedResources)
    throws OmException {
  if (initialParamNames == null) initialParamNames = new String[0];
  if (initialParamValues == null) initialParamValues = new String[0];
  if (cachedResources == null) cachedResources = new String[0];

  try {
    // Slurp values from parameters
    if (initialParamNames.length != initialParamValues.length)
      throw new OmException("Parameter name and value arrays of different length");
    long lRandomSeed = 0;
    boolean bGotRandomSeed = false;
    String sFixedFG = null, sFixedBG = null;
    boolean bPlain = false;
    double dZoom = 1.0;
    int iFixedVariant = -1;

    for (int i = 0; i < initialParamNames.length; i++) {
      String sName = initialParamNames[i], sValue = initialParamValues[i];
      if (sName.equals("randomseed")) {
        lRandomSeed = Long.parseLong(sValue);
        bGotRandomSeed = true;
      } else if (sName.equals("fixedfg")) {
        sFixedFG = sValue;
      } else if (sName.equals("fixedbg")) {
        sFixedBG = sValue;
      } else if (sName.equals("plain")) {
        bPlain = sValue.equals("yes");
      } else if (sName.equals("zoom")) {
        dZoom = Double.parseDouble(sValue);
      } else if (sName.equals("fixedvariant")) {
        iFixedVariant = Integer.parseInt(sValue);
      }
    }
    if (!bGotRandomSeed) throw new OmException("Required parameter missing: randomseed");

    // Get question into cache
    QuestionCache.QuestionKey qk = new QuestionCache.QuestionKey(questionID, questionVersion);
    obtainQuestion(questionBaseURL, qk);

    // Create and initialise question
    QuestionCache.QuestionInstance qi = qc.newQuestion(qk);
    Question q = qi.q;
    InitParams ip =
        new InitParams(lRandomSeed, sFixedFG, sFixedBG, dZoom, bPlain, qi.ccl, iFixedVariant);
    Rendering r = q.init(qc.getMetadata(qk), ip);

    // Generate session details and store in map
    QuestionSession qs = new QuestionSession();
    qs.q = q;
    qs.lLastUsedTime = System.currentTimeMillis();
    String sSession;
    synchronized (this) {
      sSession = "" + (iNextSessionID++);
      qs.sSession = sSession;
      mQuestionSessions.put(sSession, qs);
    }

    return new StartReturn(sSession, r);
  } catch (Throwable t) {
    throw handleException("start", t);
  }
}

/**
 * sets the value in the cell at columnIndex and rowIndex to aValue. but only the value and the
 * value can be changed
 *
 * @param aValue the new value
 * @param rowIndex the row index
 * @param columnIndex the column index
 * @param notify whether to notify the listeners
 */
public void setValueAt(Object aValue, int rowIndex, int columnIndex, boolean notify) {
  int type;
  int index;
  String tmp;
  Instance inst;
  Attribute att;
  Object oldValue;

  if (!m_IgnoreChanges) addUndoPoint();

  oldValue = getValueAt(rowIndex, columnIndex);
  type = getType(rowIndex, columnIndex);
  index = columnIndex - 1;
  inst = m_Data.instance(rowIndex);
  att = inst.attribute(index);

  // missing?
  if (aValue == null) {
    inst.setValue(index, Utils.missingValue());
  } else {
    tmp = aValue.toString();

    switch (type) {
      case Attribute.DATE:
        try {
          att.parseDate(tmp);
          inst.setValue(index, att.parseDate(tmp));
        } catch (Exception e) {
          // ignore
        }
        break;

      case Attribute.NOMINAL:
        if (att.indexOfValue(tmp) > -1) inst.setValue(index, att.indexOfValue(tmp));
        break;

      case Attribute.STRING:
        inst.setValue(index, tmp);
        break;

      case Attribute.NUMERIC:
        try {
          Double.parseDouble(tmp);
          inst.setValue(index, Double.parseDouble(tmp));
        } catch (Exception e) {
          // ignore
        }
        break;

      case Attribute.RELATIONAL:
        try {
          inst.setValue(index, inst.attribute(index).addRelation((Instances) aValue));
        } catch (Exception e) {
          // ignore
        }
        break;

      default:
        throw new IllegalArgumentException("Unsupported Attribute type: " + type + "!");
    }
  }

  // notify only if the value has changed!
  if (notify && (!("" + oldValue).equals("" + aValue)))
    notifyListener(new TableModelEvent(this, rowIndex, columnIndex));
}

/**
 * Returns the distance between a user and a landmark.
 *
 * @param schedule
 * @param db
 * @param userLatDegrees
 * @param userLonDegrees
 * @return
 */
private double getDistanceFromUser(
    Schedule schedule, DatabaseHandler db, double userLatDegrees, double userLonDegrees) {

  int landmarkId = schedule.getLandmarkId();
  Landmark landmark = db.getLandmark(landmarkId);

  // Get coordinates of landmark

  String landmarkXCoord = landmark.getXcoord();
  String landmarkYCoord = landmark.getYcoord();

  double landmarkLatDegrees = 0.0;
  double landmarkLonDegrees = 0.0;

  if (landmarkXCoord != null
      && landmarkXCoord.length() > 0
      && landmarkYCoord != null
      && landmarkYCoord.length() > 0) {

    landmarkLatDegrees = Double.parseDouble(landmark.getYcoord());
    landmarkLonDegrees = Double.parseDouble(landmark.getXcoord());
  }

  // If we don't have coordinates for this landmark, assume it's farthest away

  else return Double.MAX_VALUE;

  return MapHelpers.calculateDistance(
      userLatDegrees, landmarkLatDegrees, userLonDegrees, landmarkLonDegrees);
}

public boolean parseArgs(String[] args) {
  if (!super.parseArgs(args)) return false;

  // ////////////////////////////////////////////////////////////////
  //
  // Parsing command line parameters and setting up
  // Mosaic Index Builder options
  //
  // ////////////////////////////////////////////////////////////////
  inputLocation = new File((String) getOptionValue(inputLocationOpt));

  // output files' directory
  if (hasOption(outputLocationOpt))
    outputLocation = new File((String) getOptionValue(outputLocationOpt));
  else outputLocation = new File(inputLocation.getParentFile(), "tiled");
  // //
  //
  // tile dim
  //
  // //
  final String tileDim = (String) getOptionValue(tileDimOpt);
  String[] pairs = tileDim.split(",");
  tileWidth = Integer.parseInt(pairs[0]);
  tileHeight = Integer.parseInt(pairs[1]);

  // //
  //
  // Internal Tile dim
  //
  // //
  final String internalTileDim = (String) getOptionValue(internalTileDimOpt);
  if (internalTileDim != null && internalTileDim.length() > 0) {
    pairs = internalTileDim.split(",");
    internalTileWidth = Integer.parseInt(pairs[0]);
    internalTileHeight = Integer.parseInt(pairs[1]);
  }

  // //
  //
  // Compression params
  //
  // //
  // index name
  if (hasOption(compressionTypeOpt)) {
    compressionScheme = (String) getOptionValue(compressionTypeOpt);
    if (compressionScheme == "") compressionScheme = null;
  }
  if (hasOption(compressionRatioOpt)) {
    try {
      compressionRatio = Double.parseDouble((String) getOptionValue(compressionRatioOpt));
    } catch (Exception e) {
      compressionRatio = Double.NaN;
    }
  }

  return true;
}

