/**
 * Read a decimal number from the input. The next character following the number is left in the
 * input stream to be available for the next {@code getReader().get()}.
 *
 * <p>A decimal number does NOT have {@code +} or {@code -} sign, because that would cause trouble
 * parsing expressions. It contains digits, optionally decimal point and exponent part following
 * 'e' or 'E'.
 *
 * <p>Some languages allow formats like {@code 1.} or {@code .12}. This parser does not allow such
 * unreadable format. If there is a decimal point then there has to be a digit on each side.
 *
 * <p>The returned lexeme will be double if there is decimal point or exponent part or both, even
 * if the resulting value could be presented as long. Thus {@code 1.12E2} is a double number and
 * not a long containing {@code 112}.
 *
 * @return the lexical element containing the long or double value
 */
@Override
public LexicalElement read() {

  Integer ch = getReader().get();
  getReader().unget(ch);
  if (ch != null && Character.isDigit(ch)) {
    final var le = BasicLexialElementFactory.create(getReader());
    final var digits = new StringBuilder(DECIMAL_NUMBER_STRINGBUILDER_INITIAL_CAPACITY);
    processDigits(digits);
    ch = getReader().get();
    final boolean floatFormat;
    if (((Integer) (int) '.').equals(ch)) {
      floatFormat = processFraction(digits);
    } else {
      getReader().unget(ch);
      floatFormat = processExponent(digits);
    }
    final var s = digits.toString();
    le.setLexeme(s);
    if (floatFormat) {
      le.setType(LexicalElement.TYPE_DOUBLE);
      le.setDoubleValue(Double.parseDouble(s));
    } else {
      le.setType(LexicalElement.TYPE_LONG);
      le.setLongValue(Long.parseLong(s));
    }
    return le;
  } else {
    return null;
  }
}

