public static void path(String lat1, String lon1, String lat2, String lon2)
    throws JsonGenerationException, JsonMappingException, IOException {
  final Coordinate coord1 = new Coordinate(Double.parseDouble(lon1), Double.parseDouble(lat1));
  final Coordinate coord2 = new Coordinate(Double.parseDouble(lon2), Double.parseDouble(lat2));

  Path path = new Path();

  List<Integer> edgeIds = Api.graph.getEdgesBetweenPoints(coord1, coord2);

  Double total = 0.0;

  for (Integer edgeId : edgeIds) {
    TrafficEdge edge = Api.graph.getTrafficEdge(edgeId);
    Geometry geom = edge.getGeometry();

    path.distance += edge.geLength();

    org.opentripplanner.util.model.EncodedPolylineBean polylineBean =
        PolylineEncoder.createEncodings(geom);
    total +=
        Api.edgeVelocities.getStreetVelocity(BigInteger.valueOf(edgeId.longValue()))
            * edge.geLength();

    path.edgeGeoms.add(polylineBean.getPoints());
  }

  path.minSpeed = total / path.distance;
  path.maxSpeed = total / path.distance;

  renderJSON(path);
}

