      return null;
    }
  } else {
    final String splitChar;
    if (input.contains(";")) {
      splitChar = ";";
    } else if (input.contains(",")) {
      splitChar = ",";
    } else {
      return null;
    }
    final String[] parts = input.split(splitChar);
    if (parts.length != 3) {
      return null;
    }
    try {
      return new Vector(
          Double.parseDouble(parts[0]),
          Double.parseDouble(parts[1]),
          Double.parseDouble(parts[2]));
    } catch (final NumberFormatException e) {
      return null;
    }
  }
}

