/**
 * Find the approximate area value for a known location.
 *
 * @param level1Container
 * @param level0Container
 * @param aggreateLevel1PolygonArea
 * @param level1AreaSqKm
 * @return the approximate area value
 */
protected String getApproximateL1Area(
    String level1Container,
    String level0Container,
    String aggregateLevel1PolygonArea,
    String level0AreaSqKm) {

  // Find the area in polygon units of the level 1 container
  String level1PolygonArea =
      getPolygonArea(level1Container, level0Container, level1PolygonAreaList, 1);

  // Compute the approximate area, but check division by zero first.
  if (Double.parseDouble(level1PolygonArea) <= 0) {
    return DEFAULT;
  }

  double ratio =
      Double.parseDouble(level1PolygonArea) / Double.parseDouble(aggregateLevel1PolygonArea);

  String area = String.valueOf(ratio * Double.parseDouble(level0AreaSqKm));

  return area;
}

